import { Row, Col, Avatar, Image, Button } from "antd";
import React from "react";
import Story from "../../components/Story";

export default function Home() {
  return (
    <div style={{ backgroundColor: "transparent", height: 1000 }}>
      <Row>
        <Col span={24}>
          <Story />
        </Col>
      </Row>

      <Row style={{ margin: "20px 0", backgroundColor: 'white', padding: 20 }}>
        <Col span={24}>
          <div style={{ display: "flex" }}>
            <Avatar
              style={{ width: 40, height: 40 }}
              src={
                <Image
                  src="https://joeschmoe.io/api/v1/random"
                  style={{ width: 40 }}
                />
              }
            />
            <Button type="text" style={{ backgroundColor: "#F0F2F5" }}>
              Khoa ơi! bạn đang nghĩ gì thế?
            </Button>
          </div>
        </Col>
      </Row>
    </div>
  );
}
